import React from 'react';
import './App.css'
import { Route, Switch } from 'react-router-dom';
//import { getRouterConfig } from './routes/Router';
import Home from './pages/Home';

function App() {

  return (
    <div className="app">
        <Switch>
          <Route exact path='/' component={Home}></Route>
        </Switch>
    </div>
  );
}

export default App;
